		"text": "5 / 슬리퍼도 신발이기에 미적인 요소를 무시할 수 없다. 최고의 편안함을 가지지 않더라도 생김새만으로도 충분히 매력적. 심플한 디자인으로 로고도 없고, 흰색 검은색 줄도 안 그어져있다. 5가지 색상은 어느 하나 촌스럽지 않다. 아래는 토앤토의 인스타그램과 사이트에서 가져온 사진들. https://t.co/e3wXaTDNYu"
