		"text": "이렇게 되고 보니 KPAS도 별로 이상하진 않다. 처음부터 KPAS는 위급재난문자(class 0)는 CMAS 대통령령과, 나머지(class 1)는 CMAS 위기·심각 경보와 호환되었다. 안전안내문자는 WEA 안전안내보다 전(2015년)에 추가되었으니, EU-Info가 그랬듯 예약된 class 1 식별자 중 고른 게 당연한 걸 수 있다."
