		"text": "에이즈 치료제와 말라리아 치료제는 정말 코로나19에 효과가 있을까. WHO는 에볼라 치료제로 개발된 '렘데시비르'에 주목한다. 항바이러스제의 원리를 풀어봤다.ㅣ 김연희 기자\n\n코로나19 치료제로 주목받는 렘데시비르 어떤 약?\nhttps://t.co/vqYtQvwSvt"
